vector<string> update_grid(vector<string>& grid)
{
	//	Any square not emptied is left as 'O'
	vector<string> result(grid.size());
	for (int i = 0; i < grid.size(); ++i) {
		result[i] = string(grid[0].size(), 'O');
	}
	vector<pair<int,int>> adjacencies = { {-1,0}, {1,0}, {0,-1}, {0,1}, };
	for (int row = 0; row < grid.size(); ++row) {
		for (int col = 0; col < grid[0].size(); ++col) {
			//	For each input cell with a bomb, clear it and adjacent squares
			if (grid[row][col] == 'O') {
				result[row][col] = '.';
				for (const auto& x: adjacencies) {
					int delta_row = x.first;
					int delta_col = x.second;
					if (row+delta_row >= 0 && col+delta_col >= 0 && row+delta_row < grid.size() && col+delta_col < grid[0].size()) {
						result[row+delta_row][col+delta_col] = '.';
					}
				}
			}
		}
	}
	return result;
}

vector<string> bomberMan(int n, vector<string> grid)
{
	//	No cycles, return grid as-is
	if (n == 0) {
		return grid;
	}
	//	Even number of cycles, every square is 'O'
	if (n % 2 == 0) {
		vector<string> result(grid.size());
		for (int i = 0; i < grid.size(); ++i) {
			result[i] = string(grid[0].size(), 'O');
		}
		return result;
	}
	//	Each update is two iterations
	n = n / 2;
	//	Patterns repeats either every 2 or 3 iterations -> LCD is 12
	n = n % 12;
	for (int i = 0; i < n; ++i) {
		grid = update_grid(grid);
	}
	return grid;
}


